import React from "react";
import Navbar from "./components/page-sections/NavBar";
import "./App.css";
import Home from "./components/Pages/Home";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import RegisterForm from "./components/forms/RegisterForm";
import NewRecipeForm from "./components/forms/NewRecipeForm";
import Login from "./components/forms/Login";
import Cart from "./components/Cart";
import ItemDetails from "./components/Pages/ItemDetails";
import Footer from "./components/page-sections/Footer";
import EditRecipe from "./components/forms/EditRecipe";
import SearchRecipes from "./components/page-sections/SearchRecipes";
function App() {
  return (
    <>
      <Router>
        <Navbar />
        <Switch>
          <Route path="/" exact component={Home} />
          <Route path="/login" component={Login} />
          <Route path="/products" exact component={SearchRecipes} />
          <Route path="/sign-up" component={RegisterForm} />
          <Route path="/new-recipe" component={NewRecipeForm} />
          <Route path="/cart" component={Cart} />
          <Route path="/products/:id" component={ItemDetails} />
          <Route path="/edit/:id" component={EditRecipe} />
        </Switch>
        {/* <Footer /> */}
      </Router>
    </>
  );
}

export default App;
